import React, { useState } from 'react';

const FilterData = ({ data }) => {
  const [filters, setFilters] = useState({
    date: '',
    patientName: '',
    healthcareProvider: '',
    consultationType: '',
    medicalCondition: ''
  });

  const filteredData = data.filter(item => {
    return (
      item.date.includes(filters.date) &&
      item.patientName.toLowerCase().includes(filters.patientName.toLowerCase()) &&
      item.healthcareProvider.toLowerCase().includes(filters.healthcareProvider.toLowerCase()) &&
      item.consultationType.toLowerCase().includes(filters.consultationType.toLowerCase()) &&
      item.medicalCondition.toLowerCase().includes(filters.medicalCondition.toLowerCase())
    );
  });

  const handleInputChange = e => {
    const { name, value } = e.target;
    setFilters({ ...filters, [name]: value });
  };

  return (
    <div className="p-4 max-w-md mx-auto">
      <div className="mb-4">
        <input
          type="date"
          name="date"
          value={filters.date}
          onChange={handleInputChange}
          placeholder="Filter by date"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
        <input
          type="text"
          name="patientName"
          value={filters.patientName}
          onChange={handleInputChange}
          placeholder="Filter by patient name"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
        <input
          type="text"
          name="healthcareProvider"
          value={filters.healthcareProvider}
          onChange={handleInputChange}
          placeholder="Filter by healthcare provider"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
        <input
          type="text"
          name="consultationType"
          value={filters.consultationType}
          onChange={handleInputChange}
          placeholder="Filter by consultation type"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
        <input
          type="text"
          name="medicalCondition"
          value={filters.medicalCondition}
          onChange={handleInputChange}
          placeholder="Filter by medical condition"
          className="w-full p-2 mb-2 border border-gray-300 rounded"
        />
      </div>

      <div className="mt-4">
        {filteredData.length > 0 ? (
          filteredData.map(item => (
            <div key={item.id} className="border p-2 mb-2 rounded shadow-sm">
              <p><strong>Date:</strong> {item.date}</p>
              <p><strong>Patient Name:</strong> {item.patientName}</p>
              <p><strong>Healthcare Provider:</strong> {item.healthcareProvider}</p>
              <p><strong>Consultation Type:</strong> {item.consultationType}</p>
              <p><strong>Medical Condition:</strong> {item.medicalCondition}</p>
            </div>
          ))
        ) : (
          <p>No results found.</p>
        )}
      </div>
    </div>
  );
};

export default FilterData;
